document.getElementById('promo-close').onclick = function() {
    document.getElementById('bg-vkuster-promo').classList.add('promo-off');
};


var swiper = new Swiper('.swiper-container', {
    spaceBetween: 30,
    centeredSlides: true,
    speed: 2000,
    autoplay: {
        delay: 3000,
        disableOnInteraction: false
    },
    pagination: {
        el: ".swiper-pagination",
        clickable: true
    },
    loop: true,
});

$('#menu-left-1').hover(
    function(){
        $('#menu-right-1').css('display','block');
    },
    function(){
        $('#menu-right-1').css('display','none');
    },
);
$('#menu-left-2').hover(
    function(){
        $('#menu-right-2').css('display','block');
    },
    function(){
        $('#menu-right-2').css('display','none');
    },
);

var bw = jQuery( window ).width();
if(bw > 0){

    window.scroll({
        top: 1,
        behavior: 'smooth'
    });
}